"use strict";(self.webpackChunkgrc=self.webpackChunkgrc||[]).push([[13026],{8779:e=>{e.exports=JSON.parse('{"abstract":"Virtual Collaborative Environment (VCE) addresses enabling technologies to support collaborative, distributed, computer-based problem\\nsolving for engineering applications. The goal is to simulate a virtual laboratory, based on cooperative computing substrate, that integrally\\nsupports a shared workspace, high performance computing, distributed data management, as well as graphical scientific communication. In\\nthis study we present the design and development of a Windows-NT based VCE for technical computing. \xa9 2000 Elsevier Science Ltd. All\\nrights reserved.","authors":["D. Khettry","X.-H. Sun"],"date":"September, 2000","doi":"10.1016/s0965-9978(00)00020-x","links":{"pdf":"http://cs.iit.edu/~scs/assets/files/dnasa.pdf"},"month":9,"slug":"khettry-2000-windows-nt-464f","tags":[],"title":"A Windows-NT Virtual Collaboratory For Technical Computing","type":"Journal","venue":"International Journal on Advances in Engineering Software, Vol. 31, pp. 717-722","year":2000}')}}]);